(58, '2016-10-09 14:41:31', 'SONET_NEW_EVENT_GROUP', 's1', 'Y', '#DEFAULT_EMAIL_FROM#', '#SUBSCRIBER_EMAIL#', '#SITE_NAME#: #GROUP_NAME# - Новое событие группы', 'Информационное сообщение сайта #SITE_NAME#\n------------------------------------------\n\nЗдравствуйте, #SUBSCRIBER_NAME#!\n\nВ группе #GROUP_NAME# произошли следующие изменения:\n\n#TITLE#\n\n------------------------------------------\n#MESSAGE#\n------------------------------------------\n\nЧтобы попасть на сайт, пожалуйста, перейдите по ссылке:\n\nhttp://#SERVER_NAME##URL#\n\nСообщение сгенерировано автоматически.', 'Информационное сообщение сайта <?=$arParams["SITE_NAME"];?>\n\n------------------------------------------\n\nЗдравствуйте, <?=$arParams["SUBSCRIBER_NAME"];?>!\n\nВ группе <?=$arParams["GROUP_NAME"];?> произошли следующие изменения:\n\n<?=$arParams["TITLE"];?>\n\n\n------------------------------------------\n<?=$arParams["MESSAGE"];?>\n\n------------------------------------------\n\nЧтобы попасть на сайт, пожалуйста, перейдите по ссылке:\n\nhttp://<?=$arParams["SERVER_NAME"];?><?=$arParams["URL"];?>\n\n\nСообщение сгенерировано автоматически.', 'text', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
