(1, '2016-10-09 16:53:38', 1, '2016-10-09 16:53:38', 1, 1, NULL, 'Y', NULL, NULL, 500, 'Форум производителей одежды в России', 5, 'С 20 по 23 февраля состоится <strong>Форум производителей одежды в России</strong> &ndash; важнейшее мероприятии отрасли в этом году.', 'html', 6, '<p>С 20 по 23 февраля этого года состоится <strong>Форум производителей одежды в России</strong> &ndash; важнейшее мероприятии отрасли в текущем году. В экспозиции принимают участие свыше 160 компаний из <em>Беларуси, Австрии, Латвии, Литвы, России, Польши </em>и<em> Украины</em>. В составе форума состоится пять выставок:&quot;Московский Фэшн Салон&quot;, &quot;Технологии в Одежде&quot;, &quot;Офис Комфорт&quot;, &quot;Повседневная одежда&quot; и &quot;Детская одежда&quot;. Экспозиция будет строиться по принципу двух тематических секторов:<em> одежда</em> и <em>материалы для ее производства</em>.\r\n					<br />\r\n					</p>\r\n\r\n					<p>В секторе готовой одежды будут представлены:</p>\r\n\r\n					<ul>\r\n					<li>одежда для дома;</li>\r\n\r\n					<li>одежда для детей и молодежи;</li>\r\n\r\n					<li>аксессуары в одежде;</li>\r\n\r\n					<li>одежда для спорта и отдыха;</li>\r\n\r\n					<li>одежда для офиса.</li>\r\n					</ul>\r\n\r\n					<p>В секторе материалов для производства одежды будут демонстрироваться новинки рынка одежной фурнитуры, материалов, тканей, элементов и аксессуаров для производства одежды.\r\n					<br />\r\n					</p>\r\n\r\n					<p>Помимо расширенной экспозиции пяти тематических выставок &quot;Экспофорум&quot; подготовил разнообразную деловую программу форума производителей Одежды. В рамках выставки состоятся семинары и мастер-классы. И поистине масштабным в этом году обещает стать республиканский конкурс форума &quot;<strong>Народное признание</strong>&quot;. В этом году он выходит за рамки выставки и становится республиканским смотром образцов одежды.   </p>\r\n\r\n					<p><strong>Форум производителей Одежды</strong> предоставляет специалистам возможность познакомиться с тенденциями моды, провести переговоры, получить практические предложения рынка, увидеть перспективы развития и новые конкурентные преимущества. Впервые для участников конкурса будет подготовлен маркетинговый отчет по результатам опроса посетителей выставок <strong>Форума производителей Одежды</strong>.\r\n					<br />\r\n					</p>\r\n\r\n					<p><em>Прием заявок на участие в конкурсе осуществляется до 12 января этого года.</em></p>\r\n\r\n					<ul> </ul>\r\n ', 'html', 'ФОРУМ ПРОИЗВОДИТЕЛЕЙ ОДЕЖДЫ В РОССИИ\r\nС 20 ПО 23 ФЕВРАЛЯ СОСТОИТСЯ ФОРУМ ПРОИЗВОДИТЕЛЕЙ ОДЕЖДЫ В РОССИИ &NDASH; \r\nВАЖНЕЙШЕЕ МЕРОПРИЯТИИ ОТРАСЛИ В ЭТОМ ГОДУ.\r\nС 20 ПО 23 ФЕВРАЛЯ ЭТОГО ГОДА СОСТОИТСЯ ФОРУМ ПРОИЗВОДИТЕЛЕЙ ОДЕЖДЫ В РОССИИ &NDASH; \r\nВАЖНЕЙШЕЕ МЕРОПРИЯТИИ ОТРАСЛИ В ТЕКУЩЕМ ГОДУ. В ЭКСПОЗИЦИИ ПРИНИМАЮТ УЧАСТИЕ \r\nСВЫШЕ 160 КОМПАНИЙ ИЗ БЕЛАРУСИ, АВСТРИИ, ЛАТВИИ, ЛИТВЫ, РОССИИ, ПОЛЬШИ И \r\nУКРАИНЫ. В СОСТАВЕ ФОРУМА СОСТОИТСЯ ПЯТЬ ВЫСТАВОК:"МОСКОВСКИЙ ФЭШН САЛОН", \r\n"ТЕХНОЛОГИИ В ОДЕЖДЕ", "ОФИС КОМФОРТ", "ПОВСЕДНЕВНАЯ ОДЕЖДА" И "ДЕТСКАЯ \r\nОДЕЖДА". ЭКСПОЗИЦИЯ БУДЕТ СТРОИТЬСЯ ПО ПРИНЦИПУ ДВУХ ТЕМАТИЧЕСКИХ СЕКТОРОВ: ОДЕЖДА \r\nИ МАТЕРИАЛЫ ДЛЯ ЕЕ ПРОИЗВОДСТВА. \r\n \r\n\r\nВ СЕКТОРЕ ГОТОВОЙ ОДЕЖДЫ БУДУТ ПРЕДСТАВЛЕНЫ: \r\n\r\n- ОДЕЖДА ДЛЯ ДОМА; \r\n- ОДЕЖДА ДЛЯ ДЕТЕЙ И МОЛОДЕЖИ; \r\n- АКСЕССУАРЫ В ОДЕЖДЕ; \r\n- ОДЕЖДА ДЛЯ СПОРТА И ОТДЫХА; \r\n- ОДЕЖДА ДЛЯ ОФИСА. \r\n\r\nВ СЕКТОРЕ МАТЕРИАЛОВ ДЛЯ ПРОИЗВОДСТВА ОДЕЖДЫ БУДУТ ДЕМОНСТРИРОВАТЬСЯ НОВИНКИ \r\nРЫНКА ОДЕЖНОЙ ФУРНИТУРЫ, МАТЕРИАЛОВ, ТКАНЕЙ, ЭЛЕМЕНТОВ И АКСЕССУАРОВ ДЛЯ \r\nПРОИЗВОДСТВА ОДЕЖДЫ. \r\n \r\n\r\nПОМИМО РАСШИРЕННОЙ ЭКСПОЗИЦИИ ПЯТИ ТЕМАТИЧЕСКИХ ВЫСТАВОК "ЭКСПОФОРУМ" ПОДГОТОВИЛ \r\nРАЗНООБРАЗНУЮ ДЕЛОВУЮ ПРОГРАММУ ФОРУМА ПРОИЗВОДИТЕЛЕЙ ОДЕЖДЫ. В РАМКАХ ВЫСТАВКИ \r\nСОСТОЯТСЯ СЕМИНАРЫ И МАСТЕР-КЛАССЫ. И ПОИСТИНЕ МАСШТАБНЫМ В ЭТОМ ГОДУ ОБЕЩАЕТ \r\nСТАТЬ РЕСПУБЛИКАНСКИЙ КОНКУРС ФОРУМА "НАРОДНОЕ ПРИЗНАНИЕ". В ЭТОМ ГОДУ ОН \r\nВЫХОДИТ ЗА РАМКИ ВЫСТАВКИ И СТАНОВИТСЯ РЕСПУБЛИКАНСКИМ СМОТРОМ ОБРАЗЦОВ \r\nОДЕЖДЫ.    \r\n\r\nФОРУМ ПРОИЗВОДИТЕЛЕЙ ОДЕЖДЫ ПРЕДОСТАВЛЯЕТ СПЕЦИАЛИСТАМ ВОЗМОЖНОСТЬ ПОЗНАКОМИТЬСЯ \r\nС ТЕНДЕНЦИЯМИ МОДЫ, ПРОВЕСТИ ПЕРЕГОВОРЫ, ПОЛУЧИТЬ ПРАКТИЧЕСКИЕ ПРЕДЛОЖЕНИЯ \r\nРЫНКА, УВИДЕТЬ ПЕРСПЕКТИВЫ РАЗВИТИЯ И НОВЫЕ КОНКУРЕНТНЫЕ ПРЕИМУЩЕСТВА. ВПЕРВЫЕ \r\nДЛЯ УЧАСТНИКОВ КОНКУРСА БУДЕТ ПОДГОТОВЛЕН МАРКЕТИНГОВЫЙ ОТЧЕТ ПО РЕЗУЛЬТАТАМ \r\nОПРОСА ПОСЕТИТЕЛЕЙ ВЫСТАВОК ФОРУМА ПРОИЗВОДИТЕЛЕЙ ОДЕЖДЫ. \r\n \r\n\r\nПРИЕМ ЗАЯВОК НА УЧАСТИЕ В КОНКУРСЕ ОСУЩЕСТВЛЯЕТСЯ ДО 12 ЯНВАРЯ ЭТОГО ГОДА.', 1, NULL, NULL, NULL, NULL, NULL, 'N', '1', 'forum_of_producers_of_clothes_in_russia', '', '-1361114099', NULL, NULL, NULL),
(2, '2016-10-09 16:53:38', 1, '2016-10-09 16:53:38', 1, 1, NULL, 'Y', NULL, NULL, 500, 'Международная выставка одежды Salon De Fashion', 7, 'В следующем году состоится выставка одежды - Salon De Fashion, которая обещает быть еще более расширенной и интересной.', 'html', NULL, 'В следующем  году выставка Salon De Fashion обещает быть еще более расширенной и интересной. На выставке Salon De Fashion будут представлены все типы одежды для офиса и дома от платьев и шорт до VIP-аксессуаров, включая оборудование для производства и детской одежды. \r\n					<div>\r\n					<br />\r\n					</div>\r\n\r\n					<div>Заявки на участие подали более чем 1 500 компаний со всего мира. Предполагается, что за время проведения выставки ее посетят более 300 000 тысяч человек. Экспозиция выставки разместится на общей площади 149 871 кв.м. В следующем году эта поистине грандиозная выставка будет проводиться уже в 14-й раз.</div>\r\n				', 'html', 'МЕЖДУНАРОДНАЯ ВЫСТАВКА ОДЕЖДЫ SALON DE FASHION\r\nВ СЛЕДУЮЩЕМ ГОДУ СОСТОИТСЯ ВЫСТАВКА ОДЕЖДЫ - SALON DE FASHION, КОТОРАЯ \r\nОБЕЩАЕТ БЫТЬ ЕЩЕ БОЛЕЕ РАСШИРЕННОЙ И ИНТЕРЕСНОЙ.\r\nВ СЛЕДУЮЩЕМ  ГОДУ ВЫСТАВКА SALON DE FASHION ОБЕЩАЕТ БЫТЬ ЕЩЕ БОЛЕЕ РАСШИРЕННОЙ \r\nИ ИНТЕРЕСНОЙ. НА ВЫСТАВКЕ SALON DE FASHION БУДУТ ПРЕДСТАВЛЕНЫ ВСЕ ТИПЫ ОДЕЖДЫ \r\nДЛЯ ОФИСА И ДОМА ОТ ПЛАТЬЕВ И ШОРТ ДО VIP-АКСЕССУАРОВ, ВКЛЮЧАЯ ОБОРУДОВАНИЕ \r\nДЛЯ ПРОИЗВОДСТВА И ДЕТСКОЙ ОДЕЖДЫ.  \r\nЗАЯВКИ НА УЧАСТИЕ ПОДАЛИ БОЛЕЕ ЧЕМ 1 500 КОМПАНИЙ СО ВСЕГО МИРА. ПРЕДПОЛАГАЕТСЯ, \r\nЧТО ЗА ВРЕМЯ ПРОВЕДЕНИЯ ВЫСТАВКИ ЕЕ ПОСЕТЯТ БОЛЕЕ 300 000 ТЫСЯЧ ЧЕЛОВЕК. \r\nЭКСПОЗИЦИЯ ВЫСТАВКИ РАЗМЕСТИТСЯ НА ОБЩЕЙ ПЛОЩАДИ 149 871 КВ.М. В СЛЕДУЮЩЕМ ГОДУ \r\nЭТА ПОИСТИНЕ ГРАНДИОЗНАЯ ВЫСТАВКА БУДЕТ ПРОВОДИТЬСЯ УЖЕ В 14-Й РАЗ.', 1, NULL, NULL, NULL, NULL, NULL, 'N', '8', 'exhibition_salon_de_fashion', '', '926442379', NULL, NULL, NULL),
(3, '2016-10-09 16:53:38', 1, '2016-10-09 16:53:38', 1, 1, NULL, 'Y', NULL, NULL, 500, 'Новое веяние в одежде - получено прочное водостойкое соединение', 11, 'Получено новое прочное водостойкое клеевое соединение.Изобретение относится к области получения и применения клеящих составов, используемых в обработке тканей, кожи и других материалов. Данная клеевая композиция предназначена только для горячего прессования и имеет в своем составе многокомпонентный очень гибкий отвердитель. Который даст возможность делать новые виды аппликаций и соединения тканей и различных типов материалов.', 'html', 12, '<b>Авторы изобретения</b>: Разиньков Егор Михайлович и Зайцева Анна Анатольевна\r\n					<br />\r\n					Патент Российской Федерации RU2277566\r\n					<br />\r\n\r\n					<h3>Описание изобретения</h3>\r\n\r\n					<p>Изобретение относится к области получения и применения клеящих составов, используемых в производстве одежды и аксессуаров. Данная клеевая композиция предназначена только для горячего прессования и имеет в своем составе многокомпонентный гибкий отвердитель. Прототипом клеевой композиции является клей, состоящий из карбамидоформальдегидной смолы, сополимера акрилонитрила с N-винилкапролактамом и отвердитель. В качестве отвердителя применяют хлористый аммоний либо акриловую кислоту. </p>\r\n\r\n					<p>Изобретение решает задачу по получению прочного и водостойкого клеевого соединения. Это достигается тем, что клеевая композиция, включающая синтетическую смолу и отвердитель, согласно изобретению, дополнительно содержит модификатор, причем в качестве синтетической смолы клеевая композиция включает карбамидомеламиноформальдегидную смолу с отвердителем 2542, в качестве модификатора - карбамидоформальдегидную смолу, а в качестве отвердителя - 10%-ный раствор щавелевой кислоты при следующем соотношении компонентов, мас.ч.: </p>\r\n\r\n					<table cellspacing="0">\r\n					<tbody>\r\n					<tr> <td>Карбамидомеламиноформальдегидная смола</td><td>64,5-79,2</td> </tr>\r\n\r\n					<tr> <td>10%-ный Раствор щавелевой кислоты</td><td>4,4-20,5</td> </tr>\r\n\r\n					<tr> <td> Отвердитель для карбамидомеламиноформальдегидной </td><td>0,6-2,0</td> </tr>\r\n\r\n					<tr> <td> смолы 2542</td><td>13,0-15,8</td> </tr>\r\n					</tbody>\r\n					</table>\r\n', 'html', 'НОВОЕ ВЕЯНИЕ В ОДЕЖДЕ - ПОЛУЧЕНО ПРОЧНОЕ ВОДОСТОЙКОЕ СОЕДИНЕНИЕ\r\nПОЛУЧЕНО НОВОЕ ПРОЧНОЕ ВОДОСТОЙКОЕ КЛЕЕВОЕ СОЕДИНЕНИЕ.ИЗОБРЕТЕНИЕ ОТНОСИТСЯ \r\nК ОБЛАСТИ ПОЛУЧЕНИЯ И ПРИМЕНЕНИЯ КЛЕЯЩИХ СОСТАВОВ, ИСПОЛЬЗУЕМЫХ В ОБРАБОТКЕ \r\nТКАНЕЙ, КОЖИ И ДРУГИХ МАТЕРИАЛОВ. ДАННАЯ КЛЕЕВАЯ КОМПОЗИЦИЯ ПРЕДНАЗНАЧЕНА \r\nТОЛЬКО ДЛЯ ГОРЯЧЕГО ПРЕССОВАНИЯ И ИМЕЕТ В СВОЕМ СОСТАВЕ МНОГОКОМПОНЕНТНЫЙ \r\nОЧЕНЬ ГИБКИЙ ОТВЕРДИТЕЛЬ. КОТОРЫЙ ДАСТ ВОЗМОЖНОСТЬ ДЕЛАТЬ НОВЫЕ ВИДЫ АППЛИКАЦИЙ \r\nИ СОЕДИНЕНИЯ ТКАНЕЙ И РАЗЛИЧНЫХ ТИПОВ МАТЕРИАЛОВ.\r\nАВТОРЫ ИЗОБРЕТЕНИЯ: РАЗИНЬКОВ ЕГОР МИХАЙЛОВИЧ И ЗАЙЦЕВА АННА АНАТОЛЬЕВНА \r\nПАТЕНТ РОССИЙСКОЙ ФЕДЕРАЦИИ RU2277566 \r\nОПИСАНИЕ ИЗОБРЕТЕНИЯ \r\n\r\nИЗОБРЕТЕНИЕ ОТНОСИТСЯ К ОБЛАСТИ ПОЛУЧЕНИЯ И ПРИМЕНЕНИЯ КЛЕЯЩИХ СОСТАВОВ, \r\nИСПОЛЬЗУЕМЫХ В ПРОИЗВОДСТВЕ ОДЕЖДЫ И АКСЕССУАРОВ. ДАННАЯ КЛЕЕВАЯ КОМПОЗИЦИЯ \r\nПРЕДНАЗНАЧЕНА ТОЛЬКО ДЛЯ ГОРЯЧЕГО ПРЕССОВАНИЯ И ИМЕЕТ В СВОЕМ СОСТАВЕ МНОГОКОМПОНЕНТНЫЙ \r\nГИБКИЙ ОТВЕРДИТЕЛЬ. ПРОТОТИПОМ КЛЕЕВОЙ КОМПОЗИЦИИ ЯВЛЯЕТСЯ КЛЕЙ, СОСТОЯЩИЙ \r\nИЗ КАРБАМИДОФОРМАЛЬДЕГИДНОЙ СМОЛЫ, СОПОЛИМЕРА АКРИЛОНИТРИЛА С N-ВИНИЛКАПРОЛАКТАМОМ \r\nИ ОТВЕРДИТЕЛЬ. В КАЧЕСТВЕ ОТВЕРДИТЕЛЯ ПРИМЕНЯЮТ ХЛОРИСТЫЙ АММОНИЙ ЛИБО АКРИЛОВУЮ \r\nКИСЛОТУ. \r\n\r\nИЗОБРЕТЕНИЕ РЕШАЕТ ЗАДАЧУ ПО ПОЛУЧЕНИЮ ПРОЧНОГО И ВОДОСТОЙКОГО КЛЕЕВОГО \r\nСОЕДИНЕНИЯ. ЭТО ДОСТИГАЕТСЯ ТЕМ, ЧТО КЛЕЕВАЯ КОМПОЗИЦИЯ, ВКЛЮЧАЮЩАЯ СИНТЕТИЧЕСКУЮ \r\nСМОЛУ И ОТВЕРДИТЕЛЬ, СОГЛАСНО ИЗОБРЕТЕНИЮ, ДОПОЛНИТЕЛЬНО СОДЕРЖИТ МОДИФИКАТОР, \r\nПРИЧЕМ В КАЧЕСТВЕ СИНТЕТИЧЕСКОЙ СМОЛЫ КЛЕЕВАЯ КОМПОЗИЦИЯ ВКЛЮЧАЕТ КАРБАМИДОМЕЛАМИНОФОРМАЛЬДЕГИДНУЮ \r\nСМОЛУ С ОТВЕРДИТЕЛЕМ 2542, В КАЧЕСТВЕ МОДИФИКАТОРА - КАРБАМИДОФОРМАЛЬДЕГИДНУЮ \r\nСМОЛУ, А В КАЧЕСТВЕ ОТВЕРДИТЕЛЯ - 10%-НЫЙ РАСТВОР ЩАВЕЛЕВОЙ КИСЛОТЫ ПРИ \r\nСЛЕДУЮЩЕМ СООТНОШЕНИИ КОМПОНЕНТОВ, МАС.Ч.: \r\n КАРБАМИДОМЕЛАМИНОФОРМАЛЬДЕГИДНАЯ СМОЛА    64,5-79,2     \r\n 10%-НЫЙ РАСТВОР ЩАВЕЛЕВОЙ КИСЛОТЫ    4,4-20,5     \r\n ОТВЕРДИТЕЛЬ ДЛЯ КАРБАМИДОМЕЛАМИНОФОРМАЛЬДЕГИДНОЙ     0,6-2,0     \r\n СМОЛЫ 2542    13,0-15,8', 1, NULL, NULL, NULL, NULL, NULL, 'N', '9', 'waterproof_connection', '', '1824959701', NULL, NULL, NULL),
