INSERT INTO `b_iblock_section` (`ID`, `TIMESTAMP_X`, `MODIFIED_BY`, `DATE_CREATE`, `CREATED_BY`, `IBLOCK_ID`, `IBLOCK_SECTION_ID`, `ACTIVE`, `GLOBAL_ACTIVE`, `SORT`, `NAME`, `PICTURE`, `LEFT_MARGIN`, `RIGHT_MARGIN`, `DEPTH_LEVEL`, `DESCRIPTION`, `DESCRIPTION_TYPE`, `SEARCHABLE_CONTENT`, `CODE`, `XML_ID`, `TMP_ID`, `DETAIL_PICTURE`, `SOCNET_GROUP_ID`) VALUES
(16, '2016-10-09 14:14:11', 1, '2016-10-09 17:14:11', 1, 2, NULL, 'Y', 'Y', 500, 'Садовые фонари', 948, 3, 4, 1, '<p>\r\n	 Фонари ландшафтного освещения в классическом стиле\r\n</p>\r\n<p>\r\n	 Wilington представляет Вашему вниманию линейку фонарей для дома и сада. Высота фонарей от 1 до 3-х метров. Исполненные в классическом стиле, они прекрасно впишутся во многие архитектурные замыслы и существующие объекты.\r\n</p>\r\n<p>\r\n	 Применение чугуна обеспечивает прочность и надежность конструкции, а также устойчивость к внешним воздействиям.\r\n</p>\r\n <br>', 'html', 'САДОВЫЕ ФОНАРИ\r\nФОНАРИ ЛАНДШАФТНОГО ОСВЕЩЕНИЯ В КЛАССИЧЕСКОМ СТИЛЕ \r\n\r\nWILINGTON ПРЕДСТАВЛЯЕТ ВАШЕМУ ВНИМАНИЮ ЛИНЕЙКУ ФОНАРЕЙ ДЛЯ ДОМА И САДА. \r\nВЫСОТА ФОНАРЕЙ ОТ 1 ДО 3-Х МЕТРОВ. ИСПОЛНЕННЫЕ В КЛАССИЧЕСКОМ СТИЛЕ, ОНИ \r\nПРЕКРАСНО ВПИШУТСЯ ВО МНОГИЕ АРХИТЕКТУРНЫЕ ЗАМЫСЛЫ И СУЩЕСТВУЮЩИЕ ОБЪЕКТЫ. \r\n\r\nПРИМЕНЕНИЕ ЧУГУНА ОБЕСПЕЧИВАЕТ ПРОЧНОСТЬ И НАДЕЖНОСТЬ КОНСТРУКЦИИ, А ТАКЖЕ \r\nУСТОЙЧИВОСТЬ К ВНЕШНИМ ВОЗДЕЙСТВИЯМ.', 'sadovye_fonari', NULL, NULL, NULL, NULL),
(17, '2016-10-09 14:15:27', 1, '2016-10-09 17:15:27', 1, 2, NULL, 'Y', 'Y', 500, 'Парковые фонари', 949, 1, 2, 1, '<p>\r\n	 Чугунные фонари в классическом стиле\r\n</p>\r\n<p>\r\n	 Wilington представляет Вашему вниманию линейку фонарей для садов, парков и скверов, улиц и площадей. Высота фонарей от 3-х до 6-ти метров. Исполненные в классическом стиле, они прекрасно впишутся во многие архитектурные замыслы и существующие объекты.\r\n</p>\r\n<p>\r\n	 Применение чугуна обеспечивает прочность и надежность конструкции, а также устойчивость к внешним воздействиям.\r\n</p>\r\n <br>', 'html', 'ПАРКОВЫЕ ФОНАРИ\r\nЧУГУННЫЕ ФОНАРИ В КЛАССИЧЕСКОМ СТИЛЕ \r\n\r\nWILINGTON ПРЕДСТАВЛЯЕТ ВАШЕМУ ВНИМАНИЮ ЛИНЕЙКУ ФОНАРЕЙ ДЛЯ САДОВ, ПАРКОВ \r\nИ СКВЕРОВ, УЛИЦ И ПЛОЩАДЕЙ. ВЫСОТА ФОНАРЕЙ ОТ 3-Х ДО 6-ТИ МЕТРОВ. ИСПОЛНЕННЫЕ \r\nВ КЛАССИЧЕСКОМ СТИЛЕ, ОНИ ПРЕКРАСНО ВПИШУТСЯ ВО МНОГИЕ АРХИТЕКТУРНЫЕ ЗАМЫСЛЫ \r\nИ СУЩЕСТВУЮЩИЕ ОБЪЕКТЫ. \r\n\r\nПРИМЕНЕНИЕ ЧУГУНА ОБЕСПЕЧИВАЕТ ПРОЧНОСТЬ И НАДЕЖНОСТЬ КОНСТРУКЦИИ, А ТАКЖЕ \r\nУСТОЙЧИВОСТЬ К ВНЕШНИМ ВОЗДЕЙСТВИЯМ.', 'parkovye_fonari', NULL, NULL, NULL, NULL);
