(1, 'SMS', 'SMS оповещение Отправителя', 'Услуга, позволяющая путём отправки короткого SMS-сообщения уведомить Отправителя о том, что принятое к доставке/перевозке отправление/груз доставлено Получателю', '\\Bitrix\\Sale\\Delivery\\ExtraServices\\Checkbox', 'a:1:{s:5:"PRICE";i:0;}', 'NYN', 4, 'N', 'Y', 100),
(2, 'SMS_RECV', 'SMS информирование Получателя', 'Услуга, позволяющая путём отправки коротких SMS-сообщений информировать Получателя об идущем в его адрес отправлении/грузе', '\\Bitrix\\Sale\\Delivery\\ExtraServices\\Checkbox', 'a:1:{s:5:"PRICE";i:0;}', 'NYY', 4, 'Y', 'Y', 100),
(3, 'BEFORE_SIGNAL', 'Согласование даты и времени доставки', 'Услуга, позволяющая Отправителю гарантировать своему Получателю, что отправление будет доставлено в согласованное с Получателем время', '\\Bitrix\\Sale\\Delivery\\ExtraServices\\Checkbox', 'a:1:{s:5:"PRICE";i:0;}', 'NYY', 4, 'N', 'Y', 100),
(4, 'BY_HAND', 'Доставка лично в руки', 'Возможность для Отправителя заказать доставку и вручение коммерческих документов или ценных или конфиденциальных отправлений/грузов конкретному Получателю, указанному в накладной', '\\Bitrix\\Sale\\Delivery\\ExtraServices\\Checkbox', 'a:1:{s:5:"PRICE";i:0;}', 'NYY', 4, 'N', 'Y', 100),
(5, 'ICD', 'Индивидуальный контроль доставки', 'Услуга, которая позволяет осуществлять индивидуальное отслеживание и контроль процесса доставки менеджером СПСР-Экспресс, приоритетную обработку, ускорение стандартного процесса доставки и доставку отправлений/грузов в минимально возможные сроки', '\\Bitrix\\Sale\\Delivery\\ExtraServices\\Checkbox', 'a:1:{s:5:"PRICE";i:0;}', 'NYY', 4, 'N', 'Y', 100),
(6, 'TO_BE_CALLED_FOR', 'До востребования', '', '\\Bitrix\\Sale\\Delivery\\ExtraServices\\Checkbox', 'a:1:{s:5:"PRICE";i:0;}', 'NYY', 4, 'N', 'Y', 100),
(7, 'PLAT_TYPE', 'Оплата получателем', 'Услуга, дающая возможность оплаты транспортных расходов на пересылку документов или грузов Получателем, заказывается на основании гарантийного письма или договора с СПСР-Экспресс. Услуга бесплатна для Отправителя', '\\Bitrix\\Sale\\Delivery\\ExtraServices\\Checkbox', 'a:1:{s:5:"PRICE";i:0;}', 'NYN', 4, 'N', 'Y', 100);
